Description:
Société Anonyme des Eaux Minérales d'Evian (SAEME) is a subsidiary of Danone, a company with the purpose of bringing health through food to as many people as possible.

SAEME aims to inspire hydration and healthy beverages through three brands: evian® natural mineral water, La Salvetat® sparkling natural mineral water, and Badoit® sparkling natural mineral water. As a subsidiary, SAEME embraces Danone's One Planet. One Health vision that the health of the people and the health of the planet are interconnected and therefore seeks to protect and nourish both.

evian, La Salvetat and Badoit are part of the Danone #WeActForWater movement. Through #WeActForWater Danone’s water brands are: 
1.Halving the amount of virgin plastic they use, reaching 50% recycled PET (rPET) use worldwide and 100% across Europe in 2025; 
2.Accelerating towards carbon neutrality in Europe by 2025, with evian and Volvic being certified carbon neutral in 2020; 
3.Matching every liter of water sold with a litre for people in need, by creating a fund to help millions people in developing countries access safe drinking water by 2030; 
4.Enhancing watershed and wetlands preservation around the world; 
5.Expecting the collective of its water brands to achieve B Corp certification worldwide by 2022.

TOMS is a footwear and lifestyle brand using business to improve lives.  Since 2006, our community has impacted 100,000,000 lives through supporting the work of non-profit organizations around the world. 

We believe in a future where all people have a chance to thrive, that’s why we are committing 1/3 of our profits to grassroots good, in support of the people working to build a more equitable tomorrow.  Because we believe in a future where all people have a chance to thrive, our support is focused on boosting mental health, increasing access to opportunity, and ending gun violence—all elements we know to be essential for progress to take root. We are not changing the world but we are at the feet of the people who are.  So throw on your TOMS and let’s keep moving forward.

@TOMS
